import React from "react";
import { Link } from "react-router-dom";

export default function HomeNavbar() {
    return (
        <nav className="w-full flex items-center justify-between py-4 px-10 shadow-sm bg-white">
            {/* Logo */}
            <div className="flex items-center gap-2">

                <span className="text-lg font-semibold text-green-600">PureHarvest</span>
            </div>

            {/* Center Menu */}
            <div className="hidden md:flex gap-10 text-gray-700">
                <a href="#features" className="hover:text-green-600">Features</a>
                <a href="#how" className="hover:text-green-600">How It Works</a>
                <a href="#benefits" className="hover:text-green-600">Benefits</a>
            </div>

            {/* Right Menu */}
            <div className="flex items-center gap-6">
                <Link to="/login" className="text-gray-800 hover:text-green-600">Sign In</Link>
                <Link
                    to="/register"
                    className="bg-black text-white px-4 py-2 rounded-full hover:opacity-90"
                >
                    Get Started
                </Link>
            </div>
        </nav>
    );
}
